function burgerMenu(){const e=document.querySelector(".burger"),t=document.querySelector(".menu"),s=document.querySelector("body");e.addEventListener("click",()=>{t.classList.contains("active")?(t.classList.remove("active"),e.classList.remove("active"),s.classList.remove("locked")):(t.classList.add("active"),e.classList.add("active"),s.classList.add("locked"))}),window.addEventListener("resize",()=>{window.innerWidth>991.98&&(t.classList.remove("active"),e.classList.remove("active"),s.classList.remove("locked"))})}burgerMenu();const page_blog=document.querySelector("#getData");page_blog.addEventListener("click",()=>{preventDefault(),console.log("Вы открыли контакты!")});